import "./userList.css"
import { DataGrid, } from '@mui/x-data-grid';


export default function UserList() {
    const columns = [
        { field: 'id', headerName: 'ID', width: 90 },
        { field: 'user', headerName: 'User', width: 200, renderCell: (params)=>{
          return (
            <div className="userListUser">
              <img className="userListImg" src={params.row.avatar} alt=""/>
              {params.row.username}
            </div>
          )
        } },
        { field: 'email', headerName: 'Email', width: 200 },
        {
          field: 'status',
          headerName: 'Status',
          width: 120,
        },
        {
          field: 'transaction',
          headerName: 'Transaction Volume',
          width: 160,
        },
        {
          field:"action",
          headerName:"Action",
          with: 150,
          renderCell: (params)=>{
            return (
              <button className="UserListEdit">Edit</button>
            )
          }
        }
      ];

      const rows = [
        { id: 1, username: 'John Snow',
        avatar:"https://unsplash.com/photos/ZHvM3XIOHoE/download?force=true&w=640",
        email:"hon@gmail.com",
        status:"active",
        transaction:"120.00€",},

        { id: 2, username: 'John Snow',
        avatar:"https://unsplash.com/photos/ZHvM3XIOHoE/download?force=true&w=640",
        email:"hon@gmail.com",
        status:"active",
        transaction:"120.00€",},

        { id: 3, username: 'John Snow',
        avatar:"https://unsplash.com/photos/ZHvM3XIOHoE/download?force=true&w=640",
        email:"hon@gmail.com",
        status:"active",
        transaction:"120.00€",},

        { id: 4, username: 'John Snow',
        avatar:"https://unsplash.com/photos/ZHvM3XIOHoE/download?force=true&w=640",
        email:"hon@gmail.com",
        status:"active",
        transaction:"120.00€",},

        { id: 5, username: 'John Snow',
        avatar:"https://unsplash.com/photos/ZHvM3XIOHoE/download?force=true&w=640",
        email:"hon@gmail.com",
        status:"active",
        transaction:"120.00€",},
      ];

    return (
        <div className="userList">
            <DataGrid
        rows={rows}
        columns={columns}
        pageSize={5}
        rowsPerPageOptions={[5]}
        checkboxSelection
      />
        </div>
    )
}
